// Define pins for 8 LEDs
const int LED_PINS[8] = {2, 3, 4, 5, 6, 7, 8, 9};
const int MOTOR_PWM_PIN = 10; // PWM pin to control MOSFET gate (motor speed)
void setup() {
// Set all LED pins as OUTPUT
for (int i = 0; i < 8; i++) {
pinMode(LED_PINS[i], OUTPUT);
}
pinMode(MOTOR_PWM_PIN, OUTPUT); // Set MOSFET gate control pin as OUTPUT
Serial.begin(9600);
}
void loop() {
// Read the potentiometer value (0–1023)
int potentiometerValue = analogRead(POTENTIOMETER_PIN);
// Map the potentiometer value to motor speed (PWM range 0–255)
int motorSpeed = map(potentiometerValue, 0, 1023, 0, 255);
Serial.println(motorSpeed);
analogWrite(MOTOR_PWM_PIN, motorSpeed); // Set motor speed via PWM signal
// Turn OFF all LEDs initially
for (int i = 0; i < 8; i++) {
digitalWrite(LED_PINS[i], LOW);
}

