// Turn ON the corresponding LED based on the motor speed range
if (motorSpeed > 0 && motorSpeed <= 42) {
digitalWrite(LED_PINS[0], HIGH);
}
else if (motorSpeed > 42 && motorSpeed <= 84) {
digitalWrite(LED_PINS[1], HIGH);
}
else if (motorSpeed > 84 && motorSpeed <= 126) {
digitalWrite(LED_PINS[2], HIGH);
}
else if (motorSpeed > 126 && motorSpeed <= 168) {
digitalWrite(LED_PINS[3], HIGH);
}
else if (motorSpeed > 168 && motorSpeed <= 210) {
digitalWrite(LED_PINS[4], HIGH);
}
else if (motorSpeed > 210 && motorSpeed <= 252) {
digitalWrite(LED_PINS[5], HIGH);
}
else if (motorSpeed > 252 && motorSpeed <= 255) {
digitalWrite(LED_PINS[6], HIGH);
}
delay(50); // Small delay for stability
}

